import styled from "styled-components";

export const Main = styled.main`
    width: 100vw;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    border: 0.1rem solid black;
`
export const Section = styled.section`
    height: 50%;
    width: 23%;
    border: 0.1rem solid black;
    border-radius: 8px;

`
